 import React from 'react';
 import AppLink from '../link/link';

 const HeaderLogo = () => (
     <div className="logo">
         <AppLink url="/" />
         <img src="https://i.imgur.com/zqpwkLQ.png" style={{width:'50px'}}/>
     </div>
 )

 export default HeaderLogo;
